import React from "react";
import lodging from "../../data/lodging.json";
import "../styles/tags.sass"

function Tags() {
  if (!lodging || !lodging.tags) {
    return null; // Gérez le cas où les données ne sont pas disponibles
  }



  return (
      Tags = lodging.tags.map((element, index) => (
    <li className='tagLodging' key={"tagsLodg-" + index}> {element}</li>
  ))
  )
}

export default Tags;
